    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) AS cor0 WHERE - col1 / + - col0 - - - col2 NOT IN ( 39 * 59 );
  - name: tab1

outputs:
  - name: q2124.out
    data: |
      51	14	96
      85	5	59
      91	47	68
